int readingColor;
int startColor;
int Kproportional = 65;
int Kintegral = 0;
int Kderivative = 0;
int integral = 0;
int dt = 1;
int previous_error = 0;
int speed = 25;



void checkLine(){
     startColor = SENSOR_1;
     while(true){

                 readingColor = SENSOR_1;
                 int error =  startColor - readingColor;
                 int proportional = Kproportional * error/10;
                 integral = integral + error;
                 int derivative = (error - previous_error) / dt;
                 int output = proportional + Kintegral * dt* integral + Kderivative * derivative;
                 previous_error = error;
                 int left = -output + speed;
                 int right = output + speed;
				 if (left < 0 ){
					OnFwd(OUT_A,-left);
				}else{
					OnRev(OUT_A,left);
				}
				if (right < 0 ){
					OnFwd(OUT_C,-right);
				}else{
					OnRev(OUT_C,right);
				}
                 Wait(dt);
                 //TextOut(0, LCD_LINE1, NumToStr(readingColor), true);
                 TextOut(0, LCD_LINE2," l:" + NumToStr(left) + " r:" + NumToStr(right), true);
     }
}

task main(){
     SetSensorColorRed(IN_1);
     checkLine();
}
